import React from 'react';
import Amz from './AmazonComp' ;
import Netf from './NetflixComp';

const favSeries = "netflix" ;

const App = () =>(      
  <>
    <h1 className = 'heading_style'> List of top 3 Netflix movies in 2k23</h1>
    {(favSeries === "netflix") ? <Netf/> : <Amz/>} 

  </>
  
);

export default App ;
